    //驗證規則擴充
    $.validator.addMethod(""phoneStyle"", function( value, element )
    {
       var str = value;
       var result = false;

       if(str.length > 0){
           var patt_phone = /^[\d\-\(\)\#]{1,}$/;
           result = patt_phone.test(str);
       }
       else result = true;

       return result;
    }, ""電話號碼不符合格式，僅接受數字、#-()等符號"");


    $(function() {
        //初始化驗證規則
        $('#vouch').validate({
